import "./NavMenu.scss";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import Container from "react-bootstrap/Container";

const NavMenu = () => {
    return (

        <Navbar className='Navbar' collapseOnSelect expand="lg" bg="success" variant="dark">
            <Container  >
                <Navbar.Brand className='application' href="#">our application</Navbar.Brand>
                <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                <Navbar.Collapse id="responsive-navbar-nav">
                    <Nav className="me-auto">

                        <Nav.Link href="/">Home</Nav.Link>
                        <Nav.Link href="/nutrition-analysis">Nutrition analysis</Nav.Link>
                        <Nav.Link href="/recipes">Recipes</Nav.Link>
                        <Nav.Link href="/bmi">BMI</Nav.Link>
                        <Nav.Link href="/articles">Articles</Nav.Link>

                    </Nav>
                    <Nav>
                        <Nav.Link className='sign' eventKey={2} href="/sign-in">Sign In</Nav.Link>
                        <Nav.Link className='sign' href="/register">Register</Nav.Link>
                    </Nav>
                </Navbar.Collapse>
            </Container>
        </Navbar>

    );
};

export default NavMenu;
